import React, { useState } from "react";
import {
  Form,
  FormGroup,
  Label,
  Input,
  Button,
  Container,
  Alert,
  Row,
  Col,
} from "reactstrap";

const Feed = () => {
  const [formData, setFormData] = useState({
    name: "",
    event: "",
    rating: "",
    comments: "",
  });

  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Submitted:", formData);
    setSubmitted(true);
  };

  if (submitted) {
    return (
      <Container
        style={{
          minHeight: '100vh',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <Row className="justify-content-center">
          <Col md={8} lg={6}>
            <Alert color="success" className="text-center shadow-sm rounded">
              <h2 className="mb-3"> Thank you for your feedback!</h2>
              <p>Your opinion helps us improve our events.</p>
            </Alert>
          </Col>
        </Row>
      </Container>
    );
  }

  return (
    <Container
      className="justify-content-center"
      style={{
        minHeight: '00vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <Row className="justify-content-center">
        <Col md={8} lg={6}>
          <div
            style={{
              background: 'linear-gradient(135deg, #e3f0ff 0%, #f9fbfd 100%)',
              borderRadius: '18px',
              boxShadow: '0 4px 24px rgba(30, 64, 175, 0.08)',
              padding: '2rem',
              border: '1px solid #b6d0f7',
              marginBottom: '2rem',
            }}
          >
            <h2 className="text-center mb-4 text-primary">Event Evaluation Form</h2>
            <Form onSubmit={handleSubmit}>
              <FormGroup>
                <Label for="name"> Your Name</Label>
                <Input
                  type="text"
                  name="name"
                  id="name"
                  placeholder="Enter your full name"
                  value={formData.name}
                  onChange={handleChange}
                  required
                  style={{
                    background: '#f5faff',
                    border: '1px solid #b6d0f7',
                    borderRadius: '8px',
                    padding: '0.75rem',
                    fontSize: '1rem',
                    marginBottom: '0.5rem',
                    boxShadow: 'none',
                    outline: 'none',
                  }}
                />
              </FormGroup>

              <FormGroup>
                <Label for="event"> Event Name</Label>
                <Input
                  type="select"
                  name="event"
                  id="event"
                  value={formData.event}
                  onChange={handleChange}
                  required
                  style={{
                    background: '#f5faff',
                    border: '1px solid #b6d0f7',
                    borderRadius: '8px',
                    padding: '0.75rem',
                    fontSize: '1rem',
                    marginBottom: '0.5rem',
                    boxShadow: 'none',
                    outline: 'none',
                  }}
                >
                  <option value="">-- Select an Event --</option>
                  <option value="Engineering Day">Engineering Day</option>
                  <option value="Orientation Session">Orientation Session</option>
                  <option value="Workshop">Workshop</option>
                </Input>
              </FormGroup>

              <FormGroup>
                <Label for="rating"> Rating (1 to 5)</Label>
                <Input
                  type="number"
                  name="rating"
                  id="rating"
                  min="1"
                  max="5"
                  value={formData.rating}
                  onChange={handleChange}
                  required
                  style={{
                    background: '#f5faff',
                    border: '1px solid #b6d0f7',
                    borderRadius: '8px',
                    padding: '0.75rem',
                    fontSize: '1rem',
                    marginBottom: '0.5rem',
                    boxShadow: 'none',
                    outline: 'none',
                  }}
                />
              </FormGroup>

              <FormGroup>
                <Label for="comments">Additional Comments</Label>
                <Input
                  type="textarea"
                  name="comments"
                  id="comments"
                  placeholder="Share your thoughts..."
                  rows="4"
                  value={formData.comments}
                  onChange={handleChange}
                  style={{
                    background: '#f5faff',
                    border: '1px solid #b6d0f7',
                    borderRadius: '8px',
                    padding: '0.75rem',
                    fontSize: '1rem',
                    marginBottom: '0.5rem',
                    boxShadow: 'none',
                    outline: 'none',
                  }}
                />
              </FormGroup>

              <Button color="primary" block className="mt-3">
                Submit Evaluation
              </Button>
            </Form>
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Feed;
